Contract performance management:
The Contractor:
(a)	must unless otherwise stated in this Contract, use good quality, new or remanufactured and undamaged original equipment manufacturer Materials for the WUC which must be proper, adequate and suitable for the purposes which a Professional Contractor would infer from this Contract. Any remanufactured part needs to be approved by Queensland Rail before being used;
(b)	may, so as to minimise costs and lead times, use suitable parts held by the Contractor in its existing stock, provided that such parts are good quality, adequate and comply with the requirements of the Contract, specified in, or that can be reasonably inferred from, the Scope of Work;  
(c)	must perform the WUC in a good, proper and workmanlike manner and to the best practice and standard of care, skill, judgement and diligence expected of a Professional Contractor;
(d)	warrants that the Equipment, Materials and their integration to the Parent Unit, when completed, will be fit for the purpose specified in, or that can reasonably be inferred from, the Scope of Work and comply with the requirements of this Contract; and
(e)	warrants that both it and its Personnel have the skill and expertise to carry out all of the Contractor's obligations under this Contract.

The Contractor must submit reports on the progress of the Work at the frequency required by the Superintendent or the Contract, covering:
(a) the status of all aspects of the Work including work carried out by Subcontractors;
(b) a current projection of the Date of Practical Completion;
(c) changes to the Approved Contract Program dates and reasons for the changes;
(d) current or anticipated delays that may affect the Date of Practical Completion, together with remedial action proposed by the Contractor;
(e) revisions of the on-Site labour requirements estimate; and
(f) any other matter specified by the Superintendent from time to time.
